CREATE TABLE user_behaviors (
    user_id INT,
    target_id VARCHAR,
    target_type VARCHAR,
    event_timestamp TIMESTAMPTZ,
    behavior_type VARCHAR,
    parent_target_type VARCHAR,
    parent_target_id VARCHAR,
    PRIMARY KEY(user_id)
) WITH (
    connector = 'datagen',
    fields.user_id.kind = 'sequence',
    fields.user_id.start = '1',
    fields.user_id.end = '100',
    fields.user_name.kind = 'random',
    fields.user_name.length = '10',
    datagen.rows.per.second = '50'
) FORMAT PLAIN ENCODE JSON;

CREATE TABLE ck_types (
  types_id INT,
  c_boolean boolean,
  c_smallint smallint,
  c_integer integer,
  c_bigint bigint,
  c_decimal decimal,
  c_real real,
  c_double_precision double precision,
  c_varchar varchar,
  c_date date,
  c_timestamptz timestamptz,
  c_boolean_array boolean[],
  c_smallint_array smallint[],
  c_integer_array integer[],
  c_bigint_array bigint[],
  c_decimal_array decimal[],
  c_real_array real[],
  c_double_precision_array double precision[],
  c_varchar_array varchar[],
  c_date_array date[],
  c_timestamptz_array timestamptz[],
  c_struct STRUCT<s_int integer, s_boolean boolean>,
  c_jsonb: jsonb,
  PRIMARY KEY (types_id)
);

